import React from "react";
import "../styles.css";



const Counter = ({
  value,
  onIncrement,
  onDecrement,
  onIncrementAsync,
  onFetchtakeEvery, onFetchtakeLatest
}) => {
  return (
    <div className="App">
      {/*<button onClick={onIncrementAsync}>Increment after 1 second</button>{" "}
      <button onClick={onIncrement}>Increment</button>{" "}
      <button onClick={onDecrement}>Decrement</button>*/}
        <a href="#" className="button2" onClick={onFetchtakeEvery}>Fetch by takeEvery</a>
        <a href="#" className="button2" onClick={onFetchtakeLatest}>Fetch by takeLatest</a>
      <hr />
      <div>Clicked: {value.count} times</div>
      <div>{value.rotate ? <div>Wait.......</div> : <div />}</div>
        <DisplayGridData userData={value.userData} />
        <Dummy/>
    </div>
  );
};
export default Counter;


const DisplayGridData=(userData)=>{
    //console.log('Component'+ JSON.stringify(userData) + typeof userData);
    //console.log(<div>{userData.length>1 && userData.map(x=><div>{x.title}</div>)}</div>);
    //return(<div>{userData.length>1 && userData.map(x=><div>{x.title}</div>)}</div>);
    let constData='GOOD!';
    return(<div>{constData}</div>)
}



const Dummy=()=>{
    //console.log('Component'+ JSON.stringify(userData) + typeof userData);
    return(<div>Praveen</div>);
}
